import './App.css';
import Userdata from './context/Userdata';
import Main from './components/main/Main'
import { createRoot } from "react-dom/client";
import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Link,
  useParams
} from "react-router-dom";

const router = createBrowserRouter([
  {
    path: "/",
    element: (<Main/>)
  },
  {
    path: "/user/:id",
    element: (<Main/>)
  }
])


function App() {
  let {id }= useParams()
  return (
    <>
      <Userdata>
        {id}
        <RouterProvider router={router} />
      </Userdata>
    </>
  );
}

export default App;
